function.algorithm:
LOCAL
  i : INTEGER;
  category_assignments : BAG OF product_category_assignment;
  categories : SET OF STRING := [];
END_LOCAL;

category_assignments := USEDIN(obj, 'AP239_PRODUCT_DEFINITION_INFORMATION_ARM_LF.PRODUCT_CATEGORY_ASSIGNMENT.PRODUCTS');
REPEAT i := LOINDEX(category_assignments) TO HIINDEX(category_assignments) BY 1;
  categories := categories + category_assignments[i].category.name;
END_REPEAT;
RETURN (categories);

CASE rep.name OF 
  OTHERWISE:
    RETURN (UNKNOWN);
END_CASE;
